INSERT INTO `cabania` VALUES (1,'A2','Cabaña del Bosque Nativo','Rodeada de árboles autóctonos y flora local, esta cabaña permite a los visitantes sumergirse en la biodiversidad del bosque, proporcionando un ambiente acogedor y natural.',4,20000,'Al pie de los árboles nativos ubicados al este',1,2,'foto2.jpg',1),(2,'B2','Cabaña Raíces del Alma','Con un diseño rústico pero acogedor, esta cabaña ofrece un espacio íntimo que invita a la reflexión y al encuentro con uno mismo, ideal para retiros espirituales.',4,22000,'En el centro del precio, dentro del corazón del bosque',1,2,'foto3.jpg',1),(3,'B1','Cabaña Naturaleza Fiel\n','Inspirada en la armonía de la naturaleza, esta cabaña es perfecta para los amantes del aire libre, con acceso a senderos y vistas panorámicas que invitan a la exploración.',2,16000,'Dentro del sector cercado de árboles antiguos',1,1,'foto4.jpg',1),(4,'B3','Cabaña Retiro de los Maderos','Construida con maderas locales, esta cabaña combina confort y sostenibilidad, ofreciendo un refugio cálido y acogedor en medio del bosque.',6,25000,'Mano izquierda en las afueras del bosque principal',2,3,'foto5.jpg',1),(5,'C1','Cabaña Sendero Verde','Situada en un sendero lleno de vida y vegetación, esta cabaña es ideal para los amantes del senderismo, con acceso directo a rutas que exploran la belleza del entorno natural.',4,22000,'Ubicada al inicio del Sendero Verde',1,2,'foto6.jpg',1),(6,'A1','Cabaña del Agua Clara','Ubicada junto a un sereno arroyo, esta cabaña ofrece un refugio refrescante, ideal para quienes buscan tranquilidad y conexión con la naturaleza.',4,20000,'Al final del camino que bordea el arroyo',1,2,'foto1.jpg',1),(7,'C2','Cabaña Tierra Ancestral','En esta cabaña se celebra la herencia cultural de la región, creando un espacio que combina tradición y modernidad, perfecto para aquellos que buscan una conexión más profunda con la historia.',2,18000,'Junto al antiguo muelle nativo que da al lago',1,1,'foto7.jpg',1),(8,'D1','Cabaña Refugio del Árbol Sagrado','Rodeada de árboles venerados, esta cabaña ofrece un remanso de paz, ideal para quienes buscan meditación y un sentido de comunidad con la naturaleza.',5,23500,'A 100 metros del gran Árbol Sagrado que se encuentra pasando el lago',2,3,'foto8.jpg',1);
